import{_ as n,M as c,p as r,q as A,R as o,N as a,V as i,t as e,a1 as p}from"./framework-5866ffd3.js";const d="/FullStackNotes/assets/image-20230408155312903-cb6f0fa4.png",u="data:image/png;base64,",s="data:image/png;base64,",l="/FullStackNotes/assets/image-20230408155918406-1ae4d73a.png",m="/FullStackNotes/assets/image-20230408160553120-68e5e0a9.png",g="/FullStackNotes/assets/image-20230408160513726-26ee7bfc.png",h={},f=o("h1",{id:"目录",tabindex:"-1"},[o("a",{class:"header-anchor",href:"#目录","aria-hidden":"true"},"#"),e(" 目录")],-1),C={class:"table-of-contents"},N=p('<h2 id="springboot自动配置原理" tabindex="-1"><a class="header-anchor" href="#springboot自动配置原理" aria-hidden="true">#</a> SpringBoot自动配置原理</h2><h3 id="入口" tabindex="-1"><a class="header-anchor" href="#入口" aria-hidden="true">#</a> 入口</h3><p>自动配置入口为<code>@SpringBootApplication</code>注解</p><p>其中又包含了3个注解</p><ul><li>@SpringBootConfiguration：里面集成了 <code>@Configuration</code>注解，表明是个配置类</li><li>@EnableAutoConfiguration：开启自动配置功能</li><li>@ComponentScan：包扫描</li></ul><p><img src="'+d+'" alt="image-20230408155312903"></p><p><img src="'+u+'" alt="image-20230408155416632"></p><h3 id="enableautoconfiguration" tabindex="-1"><a class="header-anchor" href="#enableautoconfiguration" aria-hidden="true">#</a> @EnableAutoConfiguration</h3><p>在这个注解中通过<code>@Import</code>引入了<code>AutoConfigurationImportSelector.class</code>类</p><p>在这个类中会去加载<code>META-INF/spring.factories</code>文件</p><blockquote><p>在pom.xml中引入的每个依赖都有此文件</p></blockquote><p><img src="'+s+'" alt="image-20230408155733155"></p><p>在<code>spring.factories</code>文件中，写死了<code>SpringBoot</code>容器启动就要去加载的配置类</p><p>基本都以 <code>XXXAutoConfiguration</code> 命名</p><p><img src="'+l+'" alt="image-20230408155918406"></p><p>在对应的配置类中会通过<code>@EnableConfigurationProperties</code>开启自动配置功能，该注解会绑定一个类</p><p>在该类中会通过<code>@ConfigurationProperties</code>绑定配置文件前缀</p><p><img src="'+m+'" alt="image-20230408160553120"></p><p>并根据条件注解 <code>@Conditional</code>判断是否生效</p><p><img src="'+g+'" alt="image-20230408160513726"></p><p>生效的配置类就会在我们的容器中添加很多组件，而容器中有了这些组件，对应的功能也就有了</p><h3 id="总结" tabindex="-1"><a class="header-anchor" href="#总结" aria-hidden="true">#</a> 总结</h3><p>1、会通过 <code>@SpringBootApplication</code>注解集成的<code>@EnableAutoConfiguration</code>注解开启自动配置功能</p><p>2、在 <code>@EnableAutoConfiguration</code>注解引入的<code>AutoConfigurationImportSelector.class</code>类中加载<code>META-INF/spring.factories</code>文件</p><p>3、文件中写死了<code>SpringBoot</code>容器启动就要去加载的配置类，都以 <code>XXXAutoConfiguration</code> 命名</p><p>4、在对应的配置类中通过<code>@EnableConfigurationProperties</code>开启自动配置功能</p><p>5、通过<code>@ConfigurationProperties</code>绑定配置文件前缀</p><p>6、根据条件注解 <code>@Conditional</code>判断是否生效</p><p>7、生效的配置类就会在我们的容器中添加很多组件，而容器中有了这些组件，对应的功能也就有了</p>',29);function y(b,v){const t=c("router-link");return r(),A("div",null,[f,o("nav",C,[o("ul",null,[o("li",null,[a(t,{to:"#springboot自动配置原理"},{default:i(()=>[e("SpringBoot自动配置原理")]),_:1}),o("ul",null,[o("li",null,[a(t,{to:"#入口"},{default:i(()=>[e("入口")]),_:1})]),o("li",null,[a(t,{to:"#enableautoconfiguration"},{default:i(()=>[e("@EnableAutoConfiguration")]),_:1})]),o("li",null,[a(t,{to:"#总结"},{default:i(()=>[e("总结")]),_:1})])])])])]),N])}const k=n(h,[["render",y],["__file","AutoConfig.html.vue"]]);export{k as default};
